import React from "react";
import "./pageNotFound.css";

const Pagenotfound = () => {
  return (
    <div className="OuterContainerNotFound">
      <div className="InnerContainerNotFound">
        <h1 className="h1NotFound">
          <span className="wowtext">W0W!!!</span>You gave me a link which I
          don't have 😍
        </h1>
        <p className="pNotFound">
          In simple terms : " Page Not Found : 404 error , try again "
        </p>
      </div>
    </div>
  );
};

export default Pagenotfound;
